import {  useSelector } from "react-redux";
import "./App.css"
import BuscadorArea from "./buscador";



function App() {

  const datosBusqueda = useSelector(estado => estado.reductorBusqueda.contenidoBusqueda)





  return (
    <div className="App">

      <h1 className="custom-text-title text text-center text-primary ">Search App</h1>
      <BuscadorArea />
      <div className="image-container d-flex flex-column justify-content-center">
        <div className="content">
        {datosBusqueda.map((dato) => (<div key={dato.id} className="flex-grow-1 mb-2 mt-2 rounded float-left"><img src={dato.previewURL} alt={"Foto realizada por:  " + dato.user} /></div>))}
        </div>
      </div>
    </div>
  );
}

export default App;
